import {User} from '@components/User.js'

class Test extends Component {

    constructor(props){
        super(props)

    }

    btnClick = async () => {

        let i;

        for( i=0; i<10 ; i++ ){
            let user = new User()
            UserDataService.createUser()
        }
       

    }

